import { Outlet } from "react-router";
import { Box, Stack } from "@mui/material";

const Layout = () => {
    return (
        <Box sx={{ 
            height: '100vh'}}>
            <Box sx={{
                minHeight: '100vh',
                display: "flex"
            }}>
                <Navbar />
                <Box sx={{ width: "100%", padding: "10px", }}>
                    <Stack direction= "column" height= "100%">
                        <Box 
                        sx={{
                            padding: "15px",
                            width: "100%",
                            background: "grey",
                            borderRadius: "10px",
                            height: "100%"

                        }}>
                            <Outlet />
                        </Box>
                    </Stack>
                </Box>
            </Box>         
        </Box>

    );
}

export default Layout;
